CREATE TABLE IF NOT EXISTS category(
    id_category SERIAL PRIMARY KEY ,
    name varchar(255) not null ,
    front_image_base64 TEXT not null
);

insert into category (name, front_image_base64) values ('Clothing', 'data:image/webp;base64,');

insert into category (name, front_image_base64) VALUES ('Accessories', 'data:image/jpeg;base64,');

CREATE TABLE IF NOT EXISTS merch(
    id_merch SERIAL PRIMARY KEY ,
    description varchar(255) not null ,
    price numeric (10, 2) not null ,
    rating NUMERIC(1,0) CHECK (rating >= 1 AND rating <= 5) not null,
    front_image_base64 TEXT not null,
    category_id int not null REFERENCES category(id_category) not null
);

insert INTO merch (description, price, rating, front_image_base64, category_id) values ('Dragon Ball Vegito T-Shirt', 25.25, 3, 'data:image/webp;base64,',1);

insert INTO merch (description, price, rating, front_image_base64, category_id) values ('Dragon Ball Super Hoodie', 55.25, 4, 'data:image/jpeg;base64,', 1);

CREATE TABLE IF NOT EXISTS merch_images(
    id_merch_images SERIAL PRIMARY KEY ,
    image_base64 TEXT not null,
    merch_id int not null REFERENCES merch(id_merch) not null
);

